import logo from './logo.svg';
import './App.css';

const Header = () => {
  return (
    <header>
        Header
    </header>
  )
}
const Main = (props) => {
  return (
    <main>
      Main
      {props.childre}
    </main>
  )
}

const Section = () => {
  return(
    <section>
     Section
    </section>
  )
}
const Footer = () => {
  return ( 
    <footer>
       Footer
    </footer>
  )

}


function App() {
  return (
    <div className="App">
      <Header/>
      <Main>
       <Section/>
       <Section/>
       <Section/>
      </Main>
      <Footer/>
    </div>
  );
}

export default App;
